import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = ({ audioFile }) => {
const playAudio = () => {
if (audioFile) {
const audio = new Audio(audioFile);
audio.play();
}
};

return (
<div id="menu">
<Link className="menuItem" to="/">Home</Link>
<div className="dropdown">
<Link className="menuItem dropbtn" to="/about">About <i className="fas fa-chevron-down"></i></Link>
<div className="dropdown-content">
<Link to="/theproject">The Project</Link>
<Link to="/aboutme">About Me</Link>
</div>
</div>
<div className="dropdown">
<Link className="menuItem dropbtn" to="/insights">Insights <i className="fas fa-chevron-down"></i></Link>
<div className="dropdown-content">
<Link to="/visionfaqs">Vision FAQs</Link>
<Link to="/history">History</Link>
<Link to="/experience">Experience</Link>
</div>
</div>
<div className="dropdown">
<Link className="menuItem dropbtn" to="/support">Support <i className="fas fa-chevron-down"></i></Link>
<div className="dropdown-content">
<Link to="/steptoindependence">Step to Independence</Link>
<Link to="/servicesearch">Service Search</Link>
<Link to="/forum">Go to Forum</Link>
</div>
</div>
<div className="dropdown">
<Link className="menuItem dropbtn" to="/contact">Contact <i className="fas fa-chevron-down"></i></Link>
<div className="dropdown-content">
<Link to="/findyourorganization">Find your organization</Link>
<Link to="/findyourcommunity">Find your community</Link>
<Link to="/howyoucanhelp">How you can help</Link>
</div>
</div>
<div id="readWholePage" onClick={playAudio}>
<div id="speakerBox">
<span id="readWholePageText">Read Whole Page</span>
<i className="fas fa-volume-up" id="speakerIcon"></i>
</div>
</div>
</div>
);
};

export default Navbar;
